import React from "react";

function FirstPage() {
  const homePageFunction = () => {
    window.location.href = "/home";
  };

  const signInFunction = () => {
    window.location.href = "/login";
  };

  return (
    <div className="first-page-container">
      <img
        src="https://sv1.picz.in.th/images/2023/06/06/I09RmQ.png"
        alt="LookkaingernLogo"
        className="logo-image"
      />

      <h4 className="welcome-text">
        <b>Welcome to our restaurant</b>
      </h4>

      <div className="button-group">
        <button onClick={homePageFunction} className="button-homepage">
          Home page
        </button>
        <button onClick={signInFunction} className="button-signin">
          Login
        </button>
      </div>

      <div className="font-main">
        <span className="already-member-text">Already a member? If not</span>
        <a href="U1_SignUp.html" className="signup-link">
          Sign up
        </a>
      </div>
    </div>
  );
}

export default FirstPage;
